import { useDispatch, useSelector } from "react-redux";
import {
  fetchReposAction,
  fetchProfileAction,
} from "./redux/slices/reposSlice";
import { useEffect } from "react";
function App() {
  const dispatch = useDispatch();
  useEffect(() => {
    dispatch(fetchReposAction("tweneboah"));
    dispatch(fetchProfileAction("tweneboah"));
  }, []);
  return <section class="jumbotron bg-danger  h-100 d-inline-block"></section>;
}

export default App;
